   [168]={next_id=169, abreast_id={}, pType =1, cg_type =10, dialog=1, msg="维尔利多克家族最神秘的成员，名为珂芙尼尔的小女儿。", msg_color="", msg_size=0, talker="", audio="", img="arts/ui/bg/story/storybg_ACT208_105.jpg", video_url="", music_id="0", background_music="", model_tid={}, model_pos={}, model_move_pos={}, model_exit={}, model_show_effect={}, update_model={}, role_act={}, head_path="", shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
   [169]={next_id=170, abreast_id={}, pType =1, cg_type =10, dialog=1, msg="按照外界对她的评价，这不是一位合格的贵族小姐：她不参与任何维尔利多克家族的社交，也几乎不在公众面前露面，从不履行任何贵族小姐的职责。", msg_color="", msg_size=0, talker="", audio="", img="arts/ui/bg/story/storybg_ACT208_105.jpg", video_url="", music_id="0", background_music="", model_tid={}, model_pos={}, model_move_pos={}, model_exit={}, model_show_effect={}, update_model={}, role_act={}, head_path="", shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
